const Whitepaper = () => {
  return (
    <div className='w-full py-16 text-white px-4'>
      <div className='max-w-[1240px] mx-auto grid lg:grid-cols-3'>
        <div className='lg:col-span-2 my-4'>
          <h1 className='md:text-4xl sm:text-3xl text-2xl font-bold py-2'>
            BOKDOL COIN WHITEPAPER
          </h1>

          {/* Introduction */}
          <h2 className='text-3xl py-2'>1. Introduction</h2>
          <p>Bokdol Coin, inspired by a small, tenacious Chihuahua, is more than just another cryptocurrency. It is the embodiment of resilience, community spirit, and forward-thinking financial systems.</p>

          {/* Problem Statement */}
          <h2 className='text-3xl py-2'>2. Problem Statement</h2>
          <p>The modern cryptocurrency landscape is flooded with tokens that lack purpose and clarity. Investors are seeking tokens with transparent goals, real-world applications, and a passionate community behind them.</p>

          {/* ... Continue with other sections ... */}

          <p className='py-4'>Remember, this is a basic mockup. For your project to be successful, detailed and in-depth information is essential.</p>

          <p>Sign up to our newsletter and stay up to date.</p>
        </div>
      </div>
    </div>
  );
};

export default Whitepaper;
